import React, { useContext } from "react";
import "./styles.css";
import { ContextGlobal } from "../utils/global.context";

const Footer = () => {
  const { theme } = useContext(ContextGlobal);

  return (
    <footer style={{ backgroundColor: theme.navBackground, color: theme.font }}>
      <div>
        <p className='dhText'>Powered by</p>
        <img src="/images/DH.png" alt="DH-logo" className='dhLogo' />
      </div>

      <img className='facebookIcon' src="/images/ico-facebook.png" alt="DH-logo" />
      <img className='instagramIcon' src="/images/ico-instagram.png" alt="DH-logo" />
      <img className='whatsappIcon' src="/images/ico-whatsapp.png" alt="DH-logo" />
      <img className='tiktokIcon' src="/images/ico-tiktok.png" alt="DH-logo" />
    </footer>
  );
};

export default Footer;
